AxCalculatedMeasure.Expression:
CREATE MEMBER CURRENTCUBE.[WIPLevel] AS
Round ( SUM ( [Date].[YearTrimesterMonthTenDaysDate].[Year], ([Measures].[ActualCostAmount], ([ProductionLevel].[ProductionLevel].&[1], [ProductionOrder].[ProductionStatus].[All])) - ([Measures].[ActualCostAmount], ([ProductionLevel].[ProductionLevel].&[1], [ProductionOrder].[ProductionStatus].&[7])) ) ,2 )
,VISIBLE = 1;

CREATE MEMBER CURRENTCUBE.[DefectRatio] AS
IIF ( ISEMPTY(([Measures].[GoodQuantity] + [Measures].[ErrorQuantity])) OR ([Measures].[GoodQuantity] + [Measures].[ErrorQuantity]) = 0, NULL, Round ( ([Measures].[ErrorQuantity] / ([Measures].[GoodQuantity] + [Measures].[ErrorQuantity])) * 1000 * 1000 ,2 ) )
,VISIBLE = 1 ;

CREATE MEMBER CURRENTCUBE.[ProductionEfficiency] AS
IIF( ISEMPTY(AVG([Measures].[LeadTime])) OR AVG([Measures].[LeadTime]) = 0, NULL, Round ( AVG([Measures].[PlannedLeadTime]) / AVG([Measures].[LeadTime]) * 100 ,2 ) )
,VISIBLE = 1 ;
